import React, { Component } from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import './slider.scss';
import { SlImg } from './components';

export default class Lima extends Component {
	render(title, group) {
		var settings = {
			dots: true,
			fade: true,
			infinite: true,
			speed: 500,
			slidesToShow: 1,
			slidesToScroll: 1,
			className: 'slides',
		};
		return (
			<section>
				<Slider {...settings} className="w-70 center">
					<SlImg src="./img/lima/4.png" />
					<SlImg src="./img/lima/3.png" />
				</Slider>
				<div className="db mt2 mt1-m">
					<p className="optima f3 f4-m black fw5 pb2 pb1-m">Metro de</p>
					<p className="optima f6 silver fw4 ttu">{group}</p>
				</div>
			</section>
		);
	}
}
